webpackJsonp([48048889107819],{1761:function(a,e){a.exports={data:{markdownRemark:{html:'<p>填买房子的表格，复杂得很。然后填日本基金会的表格，也是复杂得很。现在的表格均是那样的复杂，上次写了一篇文章，叫"反对表格主义"。现代社会大概就是表格社会，美国的表格也很多，而且发达得多，日本的表格最复杂，也是日本人的特点，什么事都要搞到最小的那一点均明明白白。上次要去神户大学做访问教授，一定要问我初中是哪天毕业，高中是什么时候毕业，哪一个月?哪一天?真是荒唐，和他们有什么关系，和我做一名访问学者有什么关系?最后下决心不去，受不了这个。</p>',id:"/home/swain/workspace/political-life/src/pages/zh/0009.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/zh/0009.md",frontmatter:{title:"1月12日 星期三"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/zh/0009.md absPath of file >>> MarkdownRemark"}}}});
